            "Story": "她站在椅子上，擦着街机屏幕，打着圈，一遍又一遍，像是要擦掉每一粒灰尘。 <br>她回到了那家快餐店，那间地下室。她打开门，一切一如既往，女主人为她保留了所有的布置。 <br><br>粉色的灯光洒落在屏幕上，像是城市里的霓虹，让她想起那一夜看见的星空。 <br>她不是第一个登上那座大厦顶端的人，也不是第一个眺望那片星空的人。 <br>她知道「零号」的故事，网络战争年代最伟大的骇客、最可怕的玩家，他引起了第一次全球网络瘫痪，只为将星际和平公司的押送船叫来自家门口。 <br>她又想起「先哲」，以太编辑技术的创造者，以死者为自己命名的怪人。为了离开星球，他甘愿抛弃肉身，攻入黑域，成为一个在星际互联网络中永远徘徊的幽灵。 <br>她想起「石剑」，废品山的骄傲，他反抗绿洲区的故事在大荒野家喻户晓，有人说他最后追随巡海游侠而去，在银河中继续挥洒叛逆的火花。 <br>还有他的挚爱「孪蛇」，绿洲区的红人。她的去向众说纷纭，人们只知出身没能阻止她和石剑走到一起，银河却让他们最终分道扬镳。 <br><br>在朋克洛德，所有被称作「传奇」的骇客都走向了同一个终点。 <br>而身为如今的传奇，她知道自己也已来到那扇门前。 <br><br>哒、哒…她听见头顶传来脚步声，逐渐靠近、靠近…… <br>一个人、两个人、三个人、四个人。 <br>一个男人、一个女人、一个铁皮人，还有…… <br>她坐下来，转过身，看向空空荡荡的地下室，看向门边的那个人—— <br><br><i>「我加入。」</i> <br>名为「朋克洛德」的游戏，在这一天结束了。"
